import './ResultTable.scss'
const ResultTable = (props) => {
    return (
        <table className="result">
            <thead>
                <tr>
                    <th>Year</th>
                    <th>Total Savings</th>
                    <th>Interest (Year)</th>
                    <th>Total Interest</th>
                    <th>Invested Capital</th>
                </tr>
            </thead>
            <tbody>
                {props.data.map((yearData) => {
                    <tr>
                        <td>{yearData.year}</td>
                        <td>{yearData.savingsEndofYear - props.initialInvestemnt - yearData.yearlyContribution * yearData.year}</td>
                        <td>{yearData.yearlyInterest}</td>
                        <td>{yearData.savingsEndofYear}</td>
                        <td>{props.initialInvestemnt + yearData.yearlContribution * yearData.year}</td>
                    </tr>
                })}
            </tbody>
        </table>
    );
};

export default ResultTable;
